import { Grid } from '@mui/material'
import React, { useState } from 'react'
import Extra from '../config/components/extra'
import { Rooms } from '../config/components/obj';
import SMButton from '../config/components/button'
import { Box } from '@mui/system';
export default function Cardsss() {

    const [addRooms, setaddRooms] = useState(Rooms);


    let booknow = (data) => {
        console.log(data)
    }

    return (
        <>
            <div className='maincards'>
                <h1 >Rooms</h1>
                {addRooms.map((e) => {
                    return (
                        <Box className='cardextra'>
                            <Extra head={e.title}
                                pera={e.services}
                                image={e.images} />
                            <SMButton onClick={() => booknow(e)} label="Book Now" />

                        </Box>
                    )
                })}
            </div>
        </>
    )
}
